"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[8365],{66925:(e,t,o)=>{o.r(t),o.d(t,{default:()=>n,johnChapter9ES:()=>s});const s={chapter:9,title:"Jean 9",version:"Reina-Valera 1909",language:"es",direction:"ltr",verses:[{number:1,text:"Y pasando Jes\xfas, vi\xf3 un hombre ciego desde su nacimiento.",strong:[{text:"hombre",strong:"G444",start:24,end:30}]},{number:2,text:"Y pregunt\xe1ronle sus disc\xedpulos, diciendo: Rabb\xed, \xbfqui\xe9n pec\xf3, \xe9ste \xf3 sus padres, para que naciese ciego?",strong:[{text:"cette",strong:"G3778",start:25,end:30},{text:"homme",strong:"G444",start:65,end:70}]},{number:3,text:"Respondi\xf3 Jes\xfas: Ni \xe9ste pec\xf3, ni sus padres: mas para que las obras de Dios se manifiesten en \xe9l.",strong:[{text:"Dios",strong:"G2316",start:72,end:76}]},{number:4,text:"Convi\xe9neme obrar las obras del que me envi\xf3, entre tanto que el d\xeda dura: la noche viene, cuando nadie puede obrar.",strong:[{text:"noche",strong:"G3571",start:77,end:82},{text:"nadie",strong:"G3762",start:97,end:102}]},{number:5,text:"Entre tanto que estuviere en el mundo, luz soy del mundo.",strong:[{text:"mundo",strong:"G2889",start:32,end:37},{text:"mundo",strong:"G2889",start:51,end:56}]},{number:6,text:"Esto dicho, escupi\xf3 en tierra, \xe9 hizo lodo con la saliva, y unt\xf3 con el lodo sobre los ojos del ciego,",strong:[{text:"Esto",strong:"G3778",start:0,end:4},{text:"tierra",strong:"H776",start:23,end:29}]},{number:7,text:"Y d\xedjole: Ve, l\xe1vate en el estanque de Silo\xe9 (que significa, si lo interpretares, Enviado). Y fue entonces, y lav\xf3se, y volvi\xf3 viendo.",strong:[]},{number:8,text:"Entonces los vecinos, y los que antes le hab\xedan visto que era ciego, dec\xedan: \xbfNo es \xe9ste el que se sentaba y mendigaba?",strong:[{text:"comme",strong:"G2531",start:51,end:56}]},{number:9,text:"Unos dec\xedan: Este es; y otros: A \xe9l se parece. El dec\xeda: Yo soy.",strong:[{text:"Este",strong:"G3778",start:13,end:17}]},{number:10,text:"Y dij\xe9ronle: \xbfC\xf3mo te fueron abiertos los ojos?",strong:[]},{number:11,text:"Respondi\xf3 \xe9l y dijo: El hombre que se llama Jes\xfas, hizo lodo, y me unt\xf3 los ojos, y me dijo: Ve al Silo\xe9, y l\xe1vate: y fui, y me lav\xe9, y recib\xed la vista.",strong:[{text:"hombre",strong:"G444",start:24,end:30}]},{number:12,text:"Entonces le dijeron: \xbfD\xf3nde est\xe1 aqu\xe9l? Dice: No s\xe9.",strong:[{text:"homme",strong:"G444",start:27,end:32}]},{number:13,text:"Llevaron \xe1 los Fariseos al que antes hab\xeda sido ciego.",strong:[]},{number:14,text:"Y era s\xe1bado cuando Jes\xfas hab\xeda hecho el lodo, y le hab\xeda abierto los ojos.",strong:[{text:"jour",strong:"H3117",start:15,end:19}]},{number:15,text:"Y volvi\xe9ronle \xe1 preguntar tambi\xe9n los Fariseos de qu\xe9 manera hab\xeda recibido la vista. Y \xe9l les dijo: P\xfasome el lodo sobre los ojos, y me lav\xe9, y veo.",strong:[{text:"preguntar",strong:"G2065",start:16,end:25}]},{number:16,text:"Entonces unos de los Fariseos dec\xedan: Este hombre no es de Dios, que no guarda el s\xe1bado. Otros dec\xedan: \xbfC\xf3mo puede un hombre pecador hacer estas se\xf1ales? Y hab\xeda disensi\xf3n entre ellos.",strong:[{text:"Este",strong:"G3778",start:38,end:42},{text:"hombre",strong:"G444",start:43,end:49},{text:"Dios",strong:"G2316",start:59,end:63},{text:"hombre",strong:"G444",start:119,end:125},{text:"hacer",strong:"G1080",start:134,end:139}]},{number:17,text:"Vuelven \xe1 decir al ciego: \xbfT\xfa, qu\xe9 dices del que te abri\xf3 los ojos? Y \xe9l dijo: Que es profeta.",strong:[{text:"decir",strong:"H559",start:10,end:15}]},{number:18,text:"Mas los Jud\xedos no cre\xedan de \xe9l, que hab\xeda sido ciego, y hubiese recibido la vista, hasta que llamaron \xe1 los padres del que hab\xeda recibido la vista;",strong:[]},{number:19,text:"Y pregunt\xe1ronles, diciendo: \xbfEs \xe9ste vuestro hijo, el que vosotros dec\xeds que naci\xf3 ciego? \xbfC\xf3mo, pues, ve ahora?",strong:[{text:"hijo",strong:"G5207",start:45,end:49}]},{number:20,text:"Respondi\xe9ronles sus padres y dijeron: Sabemos que \xe9ste es nuestro hijo, y que naci\xf3 ciego:",strong:[{text:"hijo",strong:"G5207",start:66,end:70}]},{number:21,text:"Mas c\xf3mo vea ahora, no sabemos; \xf3 qui\xe9n le haya abierto los ojos, nosotros no lo sabemos; \xe9l tiene edad, preguntadle \xe1 \xe9l; \xe9l hablar\xe1 de s\xed.",strong:[{text:"hablar",strong:"H559",start:126,end:132}]},{number:22,text:"Esto dijeron sus padres, porque ten\xedan miedo de los Jud\xedos: porque ya los Jud\xedos hab\xedan resuelto, que si alguno confesase ser \xe9l el Mes\xedas, fuera fuera de la sinagoga.",strong:[{text:"Esto",strong:"G3778",start:0,end:4},{text:"miedo",strong:"H3372",start:39,end:44}]},{number:23,text:"Por eso dijeron sus padres: Edad tiene, preguntadle \xe1 \xe9l.",strong:[]},{number:24,text:"As\xed que, volvieron \xe1 llamar al hombre que hab\xeda sido ciego, y dij\xe9ronle: Da gloria \xe1 Dios: nosotros sabemos que este hombre es pecador.",strong:[{text:"llamar",strong:"H7121",start:21,end:27},{text:"hombre",strong:"G444",start:31,end:37},{text:"Dios",strong:"G2316",start:85,end:89},{text:"este",strong:"G3778",start:112,end:116},{text:"hombre",strong:"G444",start:117,end:123}]},{number:25,text:"Entonces \xe9l respondi\xf3, y dijo: Si es pecador, no lo s\xe9: una cosa s\xe9, que habiendo yo sido ciego, ahora veo.",strong:[]},{number:26,text:"Y volvi\xe9ronle \xe1 decir: \xbfQu\xe9 te hizo? \xbfC\xf3mo te abri\xf3 los ojos?",strong:[{text:"decir",strong:"H559",start:16,end:21}]},{number:27,text:"Respondi\xf3les: Ya os lo he dicho, y no hab\xe9is atendido: \xbfpor qu\xe9 lo quer\xe9is otra vez oir? \xbfquer\xe9is tambi\xe9n vosotros haceros sus disc\xedpulos?",strong:[{text:"devenir",strong:"G1096",start:126,end:133}]},{number:28,text:"Y le ultrajaron, y dijeron: T\xfa eres su disc\xedpulo; pero nosotros disc\xedpulos de Mois\xe9s somos.",strong:[{text:"disciple",strong:"G3101",start:50,end:58}]},{number:29,text:"Nosotros sabemos que \xe1 Mois\xe9s habl\xf3 Dios: mas \xe9ste no sabemos de d\xf3nde es.",strong:[{text:"Dios",strong:"G2316",start:36,end:40}]},{number:30,text:"Respondi\xf3 aquel hombre, y d\xedjoles: Por cierto, maravillosa cosa es \xe9sta, que vosotros no sab\xe9is de d\xf3nde sea, y \xe1 m\xed me abri\xf3 los ojos.",strong:[{text:"hombre",strong:"G444",start:16,end:22}]},{number:31,text:"Y sabemos que Dios no oye \xe1 los pecadores: mas si alguno es temeroso de Dios, y hace su voluntad, \xe1 \xe9ste oye.",strong:[{text:"Dios",strong:"G2316",start:14,end:18},{text:"Dios",strong:"G2316",start:72,end:76}]},{number:32,text:"Desde el siglo no fue o\xeddo, que abriese alguno los ojos de uno que naci\xf3 ciego.",strong:[{text:"dire",strong:"H559",start:22,end:26}]},{number:33,text:"Si \xe9ste no fuera de Dios, no pudiera hacer nada.",strong:[{text:"Dios",strong:"G2316",start:20,end:24},{text:"hacer",strong:"G1080",start:37,end:42},{text:"nada",strong:"G3762",start:43,end:47}]},{number:34,text:"Respondieron, y dij\xe9ronle: T\xfa eres nacido todo en pecados, \xbfy t\xfa nos ense\xf1as? Y ech\xe1ronle fuera.",strong:[{text:"todo",strong:"G3956",start:42,end:46}]},{number:35,text:"Oy\xf3 Jes\xfas que le hab\xedan echado fuera; y hall\xe1ndole, d\xedjole: \xbfCrees t\xfa en el Hijo de Dios?",strong:[{text:"Hijo",strong:"G5207",start:76,end:80},{text:"Dios",strong:"G2316",start:84,end:88}]},{number:36,text:"Respondi\xf3 \xe9l, y dijo: \xbfQui\xe9n es, Se\xf1or, para que crea en \xe9l?",strong:[{text:"Seigneur",strong:"G2962",start:28,end:36}]},{number:37,text:"Y d\xedjole Jes\xfas: Y le has visto, y el que habla contigo, \xe9l es.",strong:[]},{number:38,text:"Y \xe9l dice: Creo, Se\xf1or; y ador\xf3le.",strong:[{text:"Seigneur",strong:"G2962",start:21,end:29}]},{number:39,text:"Y dijo Jes\xfas: Yo, para juicio he venido \xe1 este mundo: para que los que no ven, vean; y los que ven, sean cegados.",strong:[{text:"juicio",strong:"G2920",start:23,end:29},{text:"este",strong:"G3778",start:42,end:46},{text:"mundo",strong:"G2889",start:47,end:52}]},{number:40,text:"Y ciertos de los Fariseos que estaban con \xe9l oyeron esto, y dij\xe9ronle: \xbfSomos nosotros tambi\xe9n ciegos?",strong:[{text:"esto",strong:"G3778",start:52,end:56}]},{number:41,text:"D\xedjoles Jes\xfas: Si fuerais ciegos, no tuvierais pecado: mas ahora porque dec\xeds, Vemos, por tanto vuestro pecado permanece.",strong:[]}]},n=s}}]);
